      "Project: Election Management System\nAdvisor: Faheem Sohail\nStatus: Complete\nDescription: The current system of identification and count of vote is operated manually. So is the  problem of casting vote, as the process of casting, counting, recording, and storing personal  information is processed manually. This manual process carries a lot of problems e.g. there is  no check and balance of vote count, timing of casting votes is also not followed strictly.  Because of manual process many votes are wasted as the person counting the votes cannot  recognize the thumb impression.     Election management system is the solution for the entire aforementioned problem this  system automates the manual record keeping; it means all the related data is now stored in the  database instead of registers, will reduce chances of error occurrence during calculation. It  will provides a facility to store and retrieve data with ease. In manual system it requires less  time in saving of records and search particular record from the bulk of data so that the legal  vote should be casted.    In the manual voting system there were security lapse like no verification of the votes, there  were mistakes regarding counting of votes but in this automated system there will be a proper  authentication of the voter and the proper verification of the votes will be done through  biometric techniques.  \uf0b7 Digital Signature  \uf0b7 Face Recognition  \uf0b7 Finger Print   \uf0b7 Voice Matching  \uf0b7 Iris Matching  In this system the \u2018thumb impression technique\u2019 and \u2018face recognition technique\u2019 are  implemented.",
