      "Project: Biometric Information System for Forensics\nAdvisor: Yaser Daanial Khan\nStatus: Complete\nDescription: Forensic officials faces a lot of problem finding the criminal just when they are given a pencil  sketch. It seems a big problem when the images to look into are in hundreds or thousands or  even more. This means that one will require to check each single image with the sketch  manually. This is a complete task for a team to be working on it for weeks or even months.  The whole process is a lot time consuming. Present forensic tools are not supporting in this  regard at all. In the current situation the process can just be facilitated by increasing the  workforce regardless of any technology used. As the process of identifying the culprit  through a sketch is done manually in most of the countries so far, the proposed technique will  work as a catalyst in this process and will help the forensics department to narrow done the  number of possibilities.   In order to provide a solution to the problem of recognition currently being faced by forensics  new approach to automate the review process based on techniques of image analysis. The  general approach is to use the sketch images to find the images of the nearest possible match  8    present in the pre-populated database of images consisting of criminals or just people in  groups in their daily routines. The mathematical computations on images to find the features  help us in identifying the characteristics and features of the face. The dataset stored is pre  populated by having all the feature values stored into database for fast retrieval.",
