      "Project: Smart Phone Based Remotely Controlled Video          Surveillance Rover\nAdvisor: Adnan Ghafoor\nStatus: Complete\nDescription: The product (Smart rover) will be a 4WD rover consisting of an ultrasonic sensor  (Sonar sensor), Arduino ADK microcontroller board based on ATmega 2560 and a  Smartphone having android OS version greater than 3.0. The microcontroller and  Smartphone will communicate via serial interface. The rover will be remotely controlled  over the internet with a web server placed in between the client and the rover. Server  will receive the directions of the rover from the client and will forward it to the  Smartphone placed in the rover. The Smartphone will forward these directions to the  microcontroller.   Smartphone will perform video surveillance by streaming the live video back to the  server, which will then be forwarded to the client by the server. On Autonomous mode,  the source and destination locations will be get from the client and the server will use  Google map API to find the directions from source to destination. After getting and  20    analyzing those directions the required path will be send to the Smartphone, which will be  forwarded to rover. Rover will start moving according to the given directions by avoiding  itself from hurdles and meanwhile server will start tracking the rover location on the  basis of GPS coordinates which will be sent from the Smartphone.   Tool;  Client side application:    Java platform required. Minimum JDK version 1.5  Server side application:   Java platform required. Minimum JDK version 1.5  Mobile side application:   Android OS. Minimum version 3.0   Embedded system:     Microcontroller:  Name:  ATmega2560  R3  Operating Voltage :12V  Flash  Memory:  256  KB  of  which  8  KB  used  by  boot  loader.  SRAM:  8  KB  EEPROM:  4  KB  Clock Speed: 16 MHz.  Ultrasonic Sensor:  Name: Parallax PING  Object detection distance: 0.75 \u2013 120 inches (2cm to 3m)",
