    responseText:
      "Project: Textual Based V ideo Indexing & Retrieving Software\nAdvisor: Muhammad Irfan Anjum\nStatus: Complete\nDescription: Video labeling is a methodology of labeling a video that indicates specific event that  occurs in the video. It helps in effective classification and searching of videos. As of now  it is being carried out manually by users or administrators. There may be sure occasions  in the video for which no labels are available. To take care of this issue we purpose a  Textual Content Based Video Indexing and Retrieving System. This system can  index and classify the video focused around the content (English text) showing up in the  video. The primary objective of this application is to retrieve specific English artificial         text from a video provided by the user. The system will then indexes the video file based  on the actual textual content (artificial text) from the video in the database. The database  can be scanned for the video containing a particular word and it will return the video  title and the time span number that contains the word.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
