      "Project: Recite: An algorithm to Identify Tajweed (Arabic Phonetics) Errors\nAdvisor: Raja Khurram Shahzad \n64\nStatus: Complete\nDescription: It is always a challenge to teach a person or a kid another language, which he/she can  speak in a native accent. Many languages are dependent upon the sound produced by the  speaker, such as Chinese language and Arabic Language. Majority of Muslims learn   65    Arabic to recite the holy Quran. Many words of Arabic language also change their m eaning, if the Tajweed (recitation) rules are not followed. To address this problem, this  project aims to build an application, which can help a user in learning Tajweed  (phonetics) to recite Quran. The proposed system will be capable of comparing the  recorded sounds and indicating the differences (or mismatched) in comparison to store  sounds in the database.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
