      "Project: 3D-BANDAR KILLA\nAdvisor: MR. ASIM RAZA\nStatus: Complete\nDescription: Currently, our cultural games (or desi games) are not played any more reasons like growing  urbanization, lack of playgrounds, and threat of terrorism. We intend to develop one of the well-known  desi games known as Bandar-Killa for mobile game users as well as for virtual reality community. Our  motivation comes from existing nostalgia for this games and by developing such a game, we hope to  contribute in the preservation of local culture in our capacity. One significant feature of our project is  that to the best of our knowledge, development of Bandar-Killa is being proposed for the first time for  the huge audience of South Asia.",
