      "Project: MOVEMENT DETECTION\nAdvisor: MR. SAEED IQBAL\nStatus: Complete\nDescription: 131        This application detects and notifies about certain human actions (sleeping, running, eating etc.) using  real time object detection and deep learning technique.  Joseph et al. proposed that humans glance at an image and instantly know what objects are in the  image, where they are, and how they interact. Current detection systems repurpose classifiers to  perform detection. YOLO a new approach to object detection. It outperforms other methods such as R- CNN and DPM. The base model processes images 45 frames per second and fast YOLO processes at  155 frames per second.  How the Detection does really happens??   Recent approaches like R-CNN use region proposal methods to \ufb01rst generate potential bounding boxes  in an image and then run a classi\ufb01er on these proposed boxes. On the other hand, YOLO reframe  object detection as a single regression problem, straight from image pixels to bounding box  coordinates and class probabilities. The system only look once (YOLO) at an image to predict what  objects are present and where they are. YOLO makes less than half the number of background errors  compared to Fast R-CNN.  The system divides the input image into an S \u00d7S grid. If the center of an object falls into a grid cell,  that grid cell is responsible for detecting that object. Moreover it stores a confidence store which  depicts the accuracy of the detection.  The model has trained its conventional layers on the ImageNet 1000-class competition dataset [1]. The  model is also been evaluated to PASCAL VOC detection dataset [2]. Thus different methods were  used to train the model for weeks and then it reached the final layer predictor which predicts both class  probabilities and bounding box coordinates.  Just like other detectors and any software YOLO too have limitations. The grids take space and can  have only one class so the nearby objects prediction % decreases an example is flock of birds. It  struggles on new objects.",
