      "Project: SMART OFFICE BOY\nAdvisor: DR. ADNAN N QURESHI\nStatus: Complete\nDescription: This project derives its inspiration from Amazons\u2019 warehouse robots which automated the system  resulting in increased productivity. This project is also inspired by the Boston Dynamics recently  created robot called \u201cSpot the dog\u201d which has superior terrain maneuverability. Our end goal will be to  create a programmed robot which will find its path to its destination intelligently and autonomously.  Named \u201cIntelligent office boy\u201d, the robot will be a very helpful tool or an extension of our limbs doing  all the trivial tasks required of it. The primary source of input will be camera, whereby our robot will  judge its movement accordingly. Our robot\u2019s autonomous behavior is achieved both by Computer  Vision and Machine Learning Algorithms. The localized camera on our robot will provide information  to be processed according to computer vision algorithms. The object avoidance and localization  problems are solved through machine learning and motion estimation techniques such as optical flow,  Lucas-Kanade algorithm, Land-marking techniques and Kalman filter algorithm etc.",
