      "Project: URDU APHASIA SPEECH THERAPY\nAdvisor: MR. MOHSIN ABBAS\nStatus: Complete\nDescription: The problem is basically that aphasia is a disease which is quite popular in Pakistan. It is caused by a  stroke and it effect\u2019s the brain due to which a person is unable to speak, listen or see properly. Old  people are mostly victim of it. Now as these patients have a high ratio, not many hospitals in Pakistan  are working on such patients, but the doctors who work in these hospitals to deal with these patients  cannot cop up for longer. They might not be available sometimes. In this case the patient who is  dependent on that doctor is disappointed and wastes the day for his cure. Also highlighting the people  from villages who can\u2019t afford to be under custody of such doctors and neither they are literate enough  to understand English language. To cater all this we are planning to build a hybrid application that will  act as a therapist and deal with patients in both English and Urdu and will help them get cured and  back to their normal selves. When this app will open it will have 3 modules one will be for seeing one  will be for hearing and the last will be for listening. When talking about the seeing module when you  will open it there will be many options like alphabets words objects colors etc. there will also be a  crossword puzzle game in this module. When coming down to the next module which is the hearing  one the user will be provided with sounds of alphabets words objects and a few more things which will  make him listen and work on his listening skills. The last module, will the speech one in which the user  will improve his speech by speaking words alphabets objects and also sentences and also stories. Each  module will have a test module in it where there will be three levels of test starting from beginner to  professional level. The professional level will be based on pure normal human senses. If the user  passes this test with a good percentage then the user can consider him cured or almost cured. Each  module will have a test of its type but there will be a test module as well in which there will an overall  test of all modules combined. It\u2019ll have three stages as well from beginner to pro level. This app will  help an aphasia patient to get back to normal. The user can use this app in Urdu and English so the one  who can\u2019t speak English or don\u2019t know about it can learn from the Urdu module like people in villages  in Pakistan. We are also planning to add a module which will also deal with translation from Urdu to  English and English to Urdu. The user will enter a sentence which will be translated to the respected  language to the user can learn translation as well and thus this will help village illiterates to learn both  languages as well. But it is optional.    152",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
