      "Project: BLOCKCHAIN BASED CROSS-BORDER REMITTANCE\nAdvisor: MR. ZAID MUNIR\nStatus: Complete\nDescription: Cross border remittances are the international transaction made by people across the world on a daily  basis. These transactions mostly include migrants sending money to their families in their home  countries. Remittances make up a good percentage of a country\u2019s capital flow, however, they are slow  to process taking up to four days for clearance. If this system is developed on the data structure of  block chain, the processing time of these transactions will be drop down to almost instantaneous.  According to World Bank by reported, the amount of remittance on a global level increased in 2018 by  10%. The global remittance percentage is expected to grow 3.7% in 2019, so the high processing time  must be lowered. One of the major reasons for remittances being slow, is that international remittances  are processed through third parties. If the system is based on block chain using hyper ledger composer,  we can implement smart contracts that will remove the third parties involvement in remittance. While  making these transactions, people have to pay some percentage of the amount to these third party    153    companies which can vary between 5-20% of the amount being transferred. Since block chain  implementation will remove the third party involvement, users will also be saving cost [er transaction.",
