      "Project: RAY OF HOPE FOR DYSLEXIC STUDENT USING E-LEARNING\nAdvisor: MS. MARIA ZAFAR\nStatus: Complete\nDescription: Dyslexia is a neurological disorder in which people have difficulties in interpreting letters and  comprehending sentences. They face difficulty in differentiating letters that appear to be similar to  them. This topic has no sort of identification platform in Pakistan. Our society fails to recognize the  importance of education for students with learning disability. We are going to develop a web-based  application and mobile based application for the dyslexic students of age group 5 - 10 which would  cover three different phases. First, we will diagnose the condition of the subject \u201cURDU\u201d through our  research and furthermore provide them with a suitable way in which they are able to read. The existing  e-learning systems will be studied and used for the purpose to gather insight about the problems that  these students go through whilst everyday learning After that user-centered-designed interface will be  tested by those same participants to tell if they see any betterment in the learning process. This would  help us to know that what major role human-computer interaction can play in improving the  concentration of the dyslexics if dealt as per their needs.",
