      "Project: GPS BASED ROAD CRACK DETECTION USING CONVOLUTIONAL  NEURAL NETWORK\nAdvisor: DR. MUHAMMAD UMAIR\nStatus: Complete\nDescription: Maintaining good condition of roads is very important to avoid different road safety hazards. Usually  the process of detecting and identifying different road damages are done by a manual approach by  conducting visual surveys. This approach costs a lot of time and money. Therefore in order to facilitate  the maintenance authorities an automated system is proposed in this project that will be able to identify  and characterize the road cracks. The proposed system will be an android application that will be used  by the general public for reporting the road cracks in their nearby areas. The app will allow the user to  take a picture of the road crack. The app will then identify the crack using a trained Convolution  Neural Network and the severity will also be calculated. This data with the GPS location of the crack  will then be sent to the maintenance authorities. The maintenance authority will be provided with a  web interface to interact with the complaints. The authorities will see the complaints on a Graphical  Map. The places with the most complaints will also be highlighted on the map for the assistance of the  authorities. The data of all the complaints including the images, severity, GPS location and type of  road crack will be maintained using a database. False reporting will also be dealt by verifying the  complaint from the nearby users.",
