      "Project: OBSTACLE  AVOIDANCE  USING  STEREO  VISION  SENSOR  IN  QUADCOPTER\nAdvisor: DR. SYED ATIF MEHDI\nStatus: Complete\nDescription: We have an Autonomous Quadcopter which has a limitation that it cannot avoid obstacles. So, we will  be developing a system for an Autonomous Quadcopter, that will avoid obstacles. A Stereo Vision  Sensor will be integrated in the Quadcopter. This sensor will be used for obstacle avoidance so that our  quadcopter can navigate in an environment without any Collison. Stereo Vision Sensor takes two  images at same time on a given baseline. Then disparity map is calculated from these images. This  disparity map is then used to generate Point Cloud. When we get Point Clouds, they give us  information about the data in the image. Then nearest objects are identified using that information  given by Point Cloud. Then by applying Obstacle Avoidance Algorithm the Quadcopter will  circumvent it through the gap. All the testing will be done in Simulation. Later if time permits it will  be ported to real Autonomous Quadcopter.              179",
