      "Project: CITRUS LEAF DISEASE DETECTION\nAdvisor: DR. SYED ATIF MEHDI\nStatus: Complete\nDescription: Agriculture is a component of Pakistan's economy as it provides the raw materials for industry down  the line and helps alleviate poverty. This sector has contributed 19.8 per cent of GDP and remains by  far the largest employer to absorb 42.3 per cent of the total labor force in the country. Currently, citrus  fruits are grown in Pakistan on an area of 206,569 hectares with a production of 2.36 million tons in  2015-16. Citrus fruits are divided into different groups of sweet oranges, mandarin, grapefruit, lemon  and lime which are commercially grown. The agriculture sector of Pakistan has been producing vast  amount of citrus fruits. Considerable amount of Kino is produced throughout the entire region of  Punjab and it supplies 2.3 million Kino per year. The agricultural institutes state the loss of citrus  production have increased in the last few years, due to the spread of citrus diseases, causing fruit and in  some cases whole tree to get infected, making it a non-consumable product. More than 98% of citrus  fruit is produced in Punjab and 70% of citrus fruit is produced in Kino. In fact, in the country, Kino  monopolized citrus farming. Unmaintained fields of citrus fruit result in rotten and useless crops. Not  every farmer has proper knowledge of the disease that citrus fruit can process. This results in great loss  of economic resources of the country. Providing services to every field to check whether the crops are  suffering from disease, which makes managing the fields difficult. Citrus fruits are infected through the  leaves which are contaminated due to diseases like citrus canker and citrus greening. Escalation of  such diseases leads to the ruin of citrus fields which can cause farmers to lose a considerable amount of  income. Detection of such diseases can save citrus fields which will, in turn, lead to effective growth in  Pakistan\u2019s GDP. As the agriculture sector contributes 42% in the entire GDP. For the detection of the  diseases, we will use a rear RGB camera of an android cellphone. The image taken from a camera will  be subjected to image preprocessing. Features will then be extracted from the image and through these  features, machine learning algorithms like SVM, K-MEANS and CNN will be able to classify and  detect the disease.            199",
