      "Project: SIGNATURE VERIFICATION SYSTEM\nAdvisor: MR. AWAIS M. LODHI\nStatus: In Process of Completion\nDescription: Our product is a windows compatible software which is known as \u201cSVS\u201d (Signature verification  system) and it is used to distinguish between real signatures and forged signatures. The area of  Handwritten Signature Verification has been broadly researched in the last decades and still remains as  an open research problem. This report focuses on offline signature verification, characterized by the  usage of static (scanned) images of signatures, where the objective is to discriminate if a given  signature is genuine (produced by the claimed individual), or a forgery (produced by an impostor). We  present an overview of how the problem has been handled by several researchers in the past few  decades and the recent advancements in the field. The offline Handwritten Signature Verification  (HSV) problem can be considered as having difficult data since it presents imbalanced class  distributions, high number of classes, high-dimensional feature space and small number of learning  samples. No wonder that institutions and businesses recognize signatures as the primary way of  authenticating transactions. People sign checks, authorize documents and contracts, validate credit card  transactions and verify activities through signatures. As the number of signed documents and their  availability has increased tremendously, so has the growth of signature fraud. According to recent  studies, only check fraud costs banks about $900M per year with 22% of all fraudulent checks  attributed to signature fraud. Clearly, with more than 27.5 billion (according to the 2010 Federal  Reserve Payments Study) checks written each year in the United States, visually comparing signatures  with manual effort on the hundreds of millions of checks processed daily proves impractical.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
