      "Project: SPOTGARBAGE\nAdvisor: MR. KAMRAN SHABBIR\nStatus: Complete\nDescription: Waste management in Pakistan is a matter of big concern. According to research, more than 5 million  people die each year in Pakistan due to waste-related disease. It is estimated roug0hly that 20 million  tons of the total garbage is produced every year in Pakistan. Pakistan being the 6th most populated  country in the world has a lot of consumers and as a result of that, a lot of garbage is produced, and  annually, 250,000 tons of waste is being produced by hospitals which are toxic of all the. There is a  lack of facilities in Pakistan to maintain the garbage causing hazardous toxins to be exposed thereby  threatening human and environmental health. People being exposed to toxic wastes causing different  types of skin problems and lung problems. This toxic waste contaminates groundwater. Contaminated  water can have a serious impact on all living creatures, including humans, in an ecosystem. It is  causing diseases like hepatitis which is a deadly disease. It claims nearly 150,000 lives every year  being a direct cause of death or morbidity and it means that over 400 people are losing life to hepatitis  every day here in the country.  We are trying to step up from the manual Garbage Management System to the autonomous Web and  Application-related interface. For this, we need to train a machine to detect garbage from the image by  comparing it to the pre-fed dataset of garbage. But due to a lack of resources, we will first make our  dataset by taking manual snaps of garbage heaps and dumps. This application allows people to click an  image of the garbage and send the prediction information along with the geo-coordinates (Longitude  and Latitude) to the municipality for clean-up by using several tools and real-time detection. The  detection will be done using image processing and machine learning techniques. In addition, this  application will be doing route optimization and planning for the waste busters trucks. The route will  be mapped, for all the pictures received in a specific time slot.                  222",
