      "Project: STOCK MARKET FORECASTING USING TIME SERIES ANALYSIS\nAdvisor: DR. SYED ATIF MEHDI\nStatus: Completed\nDescription: Time series analysis and forecasting is a useful technique for identifying essential trends that can be  helpful to make future decisions. One of the most challenging issues in the modern economy is making  financial judgments under numerous sorts of economic policies and reforms. High volatility shifts in  instability patterns are common on the Pakistan Stock Exchange (PSE). When it comes to Monopoly  and stock market predictions, there are numerous aspects to consider. We started with a static website,  then moved to a dynamic web application, but the data was still stored statically. Now, we've moved to  a full Mern Stack application that scrapes the data on the runtime and displays it to the user. The user  can download the data as a csv file to check the historical data, and the user can also see a candlestick  chart to help him understand the stock's trend. The numerous models used in stock market forecasting  provided have all been classified in terms of data preparation, forecasting methodology, performance  evaluation, and performance measure. However, in order to attain high forecasting accuracy, these  discussed models have not been sufficiently discussed in data preparation in order to overcome the  issues  of  randomness,  uncertainty,  and  stock  price  volatility.We started by attempting to anticipate only the Pakistan Stock Exchange (PSE), but now we'r e aiming to predict overseas stocks as well, based on our data collection and many models. The Arima  model, the long-short term memory model (LSTM), the linear regression and a few others were  observed. The long-short-term model (LSTM) and the hidden Markov model (hmm) results are  encouraging.. We chose the long-short term model (LSTM) and ARIMA because their root mean  square error (RMSE) is lower than others.",
