      "Project: HELPING THE TRAUMATIZED KIDS\nAdvisor: MR. M. BILAL KHAN\nStatus: Completed\nDescription: People of different age groups suffer from some sort of Mood swings leading to trauma; there might be  several reasons of their occurrence. We are focusing at the age group of 11 to 13 as this age group  must be cured specially, these years are considered to be life changing years. Some students between  the ages of 11-13 go through a certain mood swing even with access to education many children are  getting hyper and are unable focus on learning due to the multiple mood swings whether it be due to    247    financial issues, emotional abuse, parental loss, homelessness, or any other hardships that they have  suffered. We aim to identify such kids by conducting research and meeting the people involved in the  therapies. We will meet the kids living in shelter homes etc. and will conduct their interviews. We can  then discuss it with a professional to understand the mood swing the kid is facing at that time. These  mood swings can include a variety of responses, such as Lack of impulse control, intense emotional  upset, anxiety, behavioral changes, difficulties with self-regulation, attention and academic difficulties,  nightmares and difficulty in sleeping and eating. A mood swing can be converted into a traumatic  condition if are not able to take care of them at early stage. Natural disasters and wars play a major part  in the development of the traumatic conditions, apart from that other factor are also the key factors, for  example, family issues, accidents, illness, or the recent pandemic Covid-19. We will develop an app  after this research which will help to reduce the Traumatic reactions by using pre-existing available  therapies Introduction.",
