      "Project: 833.  LEUKEMIA DETECTION AND CLASSIFICATION IN BLOOD SMEARS  USING DEEP LEARNING\nAdvisor: MR. SAAD AZHAR SAEED\nStatus: Completed\nDescription: Leukemia is the cancer developed in blood forming tissues of the body mainly bone marrow and  lymphatic system. It has two main types namely Acute and Chronic. These are further divided into two  subtypes, Lymphoid and Myeloid. The diagnosis of leukemia is most commonly carried out using  cytogenetic testing i.e., observing microscopic blood smears and bone marrow images. These manual  testing methods take weeks to process and detect the cancer. Multiple machine learning techniques  such as k-nearest neighbor, na\u00efve Bayes, support vector machine, decision table are also used for  comparatively faster diagnosis than the traditionally used manual methods [1]. Still the result of such  methods and the time they take for the diagnosis is not satisfactory. To make the overall process more  efficient and precise, we will use Image Processing techniques (Image Segmentation, enhancement,  and augmentation) to achieve the most out of the limited datasets available, and then CNN models  which perform much better than traditional models by automatically extracting related features and  classifying cancer in same and sometimes lesser time span will be used.",
