      "Project: AUTO MUSIC GENERATOR USING FACIAL EXPRESSION\nAdvisor: MR. WAQAR MUGHAL\nStatus: Completed\nDescription: We are fostering a versatile application that plans to utilize Artificial Intelligence and Machine  Learning to carry out creating music with the assistance of facial acknowledgment. In this venture we  will prepare a model trained on a dataset of tones from instruments like Piano. The application will use  the camera from the Smart phone to distinguish the presence of the client and guarantee the liveness of  the video feed. Assessment of the expressions and emotions the application will create music at run  time. We believe a multi-channel Convolutional Neural Network (CNN) is a way better way to deal  with distinguish designs like these since it gives a worldwide normal layer. Each time the application is  dispatched new music will be generated to guarantee uniqueness and will be played on the music  player inside the application. The unique aspect of this project that it utilizes facial expression and  evaluation to generate the music. For instance, when the user is in front of the camera it will first verify  if the subject is live or not. Then, it will utilize machine learning algorithms to distinguish the facial  expression. If the user is smiling, then that implies that the user is in a joyous or a pleasant mood.  Using this data from the live feed the algorithm will get the input of mood, which will the generate  music from a model trained on a piano tones dataset to create new and unique tunes. These tunes will  be played in the music player. Also we are ensuring that the data is not being collected for malicious or  personal intents through our application, this is being done to maintain security and integrity of the  application. The video feed will not be recorded for security purposes. It will ask for the users consent  to use the camera and during the live feed no recording will take place. Also the user can replay the  music generated by the application using the music player.      257",
