      "Project: ALZHEIMER PATIENT SUPPORT\nAdvisor: MS. MARIA ZAFAR\nStatus: Completed\nDescription: 259      Alzheimer is one of the most advanced forms of dementia which has been one of the most common  illnesses in today's world. It slowly destroys the thinking ability of an individual in the sense that the  individual loses the ability to think or perform the daily life chores, and stops living the normal  lifestyle.  The treatment to this specific illness is as complex as the illness itself, and is usually very  costly. As a solution to assist caretakers; our product targets the main issues which have to be dealt  with, which cover food, medication, sleep, and tracker. Alzheimer patient support is a hardware- software solution-based product which is a cost-effective solution to the illness of Alzheimer which  cannot be fully treated but can be slowed down with its progress among any individual who is  diagnosed with it.  We will be using sensors (pressure and motion) to generate signals using our  hardware devices which include smart medication box, smart food box, wearable device which will  make sure that the individual who is diagnosed with Alzheimer has a proper diet and medication  intake, along with that whether the individual has been able to have a normal sleep pattern and the live  location of the individual will also be noted all the time. All of these details will be noted through  forms of graphical representation in our software solution which is the mobile application. The device  and mobile application both will be controlled by the care-taker of that particular patient and these  records will be saved in the database of the application through which our product will give a record of  the conditions and progress of the patient so that the care-taker and the medical officers both will be  able to comprehend the condition process of that individual. Thus, Alzheimer patient support as a  whole will be a cost effective solution to this real life problem and will enable the patients to get back  to their normal lifestyle of life and feel less like a patient.",
