      "Project: EASYSHOP (OBJECT DETECTION)\nAdvisor: MR. HAROON ABDUL WAHEED\nStatus: Completed\nDescription: Efficient and accurate object detection has been an important topic in the advancement of computer  vision systems. The project aims to incorporate state-of-the-art techniques for object detection to  achieve accuracy with real-time performance. A major challenge in many of the object detection  systems is the dependency on other computer vision techniques for helping the deep learning-based  approach, which leads to slow and non-optimal performance. Computer vision is consists of various  aspects like image recognition, image generation, object detection. In this project, we are using highly  accurate object detection algorithms and methods such as R-CNNN, Fast-RCNN, Faster-RCNN,  RetinaNet, and fast yet highly accurate ones like SSD and YOLO. Using these methods and  algorithms, based on deep learning which is also based on machine learning requires lots of  mathematical and deep learning frameworks understanding by using dependencies such as  TensorFlow, OpenCV, imageAi, etc, we can detect every object in an image by the area object in a  highlighted rectangular boxes and identify every object and assign its tag to the object. This also  includes the accuracy of each method for identifying objects. In this project, we use a completely deep  learning-based approach to solve the problem of object detection in an end-to-end fashion.",
