      "Project: DIABETIC RETINOPATHY DETECTION USING MACHINE LEARNING\nAdvisor: MR. MOHSIN SAMI\nStatus: Completed\nDescription: In today\u2019s time; researchers, scientists and health workers are looking forward on advanced  technologies that can help and speed-up the medical processes but are also budget friendly. Keeping all  these factors in consideration we have come forward with an advanced technology of Deep Learning  that will help in Diagnosis of Diabetic Retinopathy (DR). Diabetic retinopathy is a common  complication of diabetes and major cause of vision impairment and blindness worldwide. It is a  condition caused by diabetes that affects the retina damaging retinal blood vessels making them leaky  or blocked. Abnormal blood vessels can grow from the retina, which can bleed or cause scarring of the  retina and result in permanent vision impairment or blindness. Vision impairment most commonly  occurs due to thickening in the central part of the retina (diabetic macular edema), which can lead to  irreversible vision impairment. In present times, the diagnosis is done by subjective human evaluation  that is slow, time-consuming and resulting in clinically hard monitoring of DR. With our automated  approach, the process of diagnosing such a disease can be easier, flexible, fast and most importantly;  budget friendly. Furthermore, it can prevent the loss of vision in up to 95% of cases by early detection,  combined with appropriate treatment and management. DR is the manifestation of systemic disease,  which affects up to 80% of all patients who have had diabetes for 10 years or more. Automated DR can  be implemented using various algorithms like computer vision, machine learning/deep learning, and  deep neural networks. But deep learning in general has achieved high validation accuracies. So, based  on our research we will be using Deep Learning for our project and Python computer language along  with some Image Processing techniques. Following are the different stages that we will go through to  complete this project.",
