      "Project: SDN BASED DDOS ATTACK DETECTION\nAdvisor: MS. SARAH JAVED\nStatus: Completed\nDescription: Software Defined network (SDN) is an evolving field for the management and designing of computer  networks. The main concept behind SDN is to separate the control plane from data planes. The  structure of controller is centralized so, DDoS (Distributed Denial of Service) attack that can easily  exhaust the switches and their communication and computing resources and also the controller. Thus,    <S25BS005>  SDP Phase I (RS)  Page 294  they breakdown the whole network within a short time. This method will detect and also mitigate the  DDoS attack by using hybrid technique entropy and destination IP address and time-based mitigation.  The main objective of this research is to propose a light weight and reliable method to detect the range  of DDoS attack at its early stage. In old-style networks by congesting, they try to bring down the  services running in the network. With extra traffic loads or to reduce the network speed by congesting  the available bandwidths. Therefore, a huge load of attack traffic targets a certain destination. In  software defined networking the attack traffic could be distributed as much to skip the detection  mechanisms to target the controller and switches.",
