      "Project: SELF ORGANIZING REFLECTIVE NEURAL NETWORK FOR LIFELONG  LEARNING\nAdvisor: DR. FARHAN DAWOOD\nStatus: Completed\nDescription: The project is based on the concept of Lifelong learning, also known as Incremental Learning and  Continual Learning. The system will learn new information incrementally without forgetting  previously learned information and through regularly reflecting upon previously learned information as  well. Cognitive machines encounter data in a challenging environment and the data is dynamic. The  data is an infinite stream and is non-stationary due to which these machines must adapt to drastic  changes in input and retain previously learned information as well. Our proposed system will learn  new information incrementally by preserving previously learned information and regularly reflecting  upon the previously learned information as well. The algorithm uses Self-Organizing Increment Neural  Network (SOINN) to learn data incrementally and uses a clustering algorithm based on Adaptive  Resonance Theory(ART) and Grows When Required(GWR) to regularly reflect upon previously  learned data. The results to be acquired from this project will demonstrate its performance in self- organizing the network, classification of data and regular reflection upon previously learned  information.",
