      "Project: BLOCKCHAIN BASED DEGREE VERIFICATION SYSTEM (dApp)\nAdvisor: MR. ASIF FAROOQ\nStatus: Completed\nDescription: Nowadays, a very crucial issue challenges us where the credentials, the degree and transcript of an  individual go through quite a bit of scrutiny before they are verified due to the height of  false/fraudulent credentials being manufactured by individuals every day. Such a task should not be as  difficult as is the current practice. There is a dire need for a reform to take place where the individual  may focus on more crucial aspects of their professional career instead of focusing on passing through  the red-tapism to get their degree verified.  On the other hand, there is also a need for employers to verify the credentials of an individual directly  instead of contacting the relevant authorities repeatedly.  Previously, this was implemented by using normal databases, but those systems fall victim to  intrusions and fraudulent changes to the original credentials of an individual.  The need for a secure method to implement this system demands the use of blockchain to accomplish  this task. Blockchain is a secure platform which with the use of smart contracts would ensure that the  credentials entered have been verified by the authorities and no further verification is needed for the  employer or for the individual.  Degrees and transcripts can be verified through such a system where the administration can enter the  credentials of the individuals and the smart contract will be deployed on the TestNet which cannot be  changed once deployed where it can be verified by employers or can be attached in the resume by the  individual. Verification will be done by a web interface which will have different profiles for  individuals, employers, and admins, each having a certain level of authority.",
