      "Project: OFFLINE SIGNATURE VERIFICATION SYSTEM\nAdvisor: MR. AWAIS M. LODHI\nStatus: Completed\nDescription: <S25BS005>  SDP Phase I (RS)  Page 318  This project aims to assist organizations in identification of original signatures of a person to avoid  forgery using a Desktop based application having a trained model with deep learning (neural networks)  and image processing algorithms implemented. Present autonomous signature verification systems are  based on live identification of signature based on the pressure at pen tip and its movement between X  and Y coordinates which is termed as online SVS and can only be beneficial during live signature  verification. However, many organizations need to verify signatures several times, so online signature  verification cannot be used everywhere since it requires real time signatures. To overcome this issue  Offline signature verification system is needed so that signatures can be verified anytime, when  needed, merely with the help of signature image. A modified version of traditional twin Siamese  network i.e., 5 ways Siamese network will be used wherein 4 genuine signature images and one test  image will be inputted and decision of the authenticity of image will be based upon the similarity  between test image and 4 genuine images, once the model is completed the results will be compared  with existing models which compares 1 genuine image with test image.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
