      "Project: AUTOMOBILE CLASSIFICATION (EYE ON AUTOMOBILE)\nAdvisor: MR. AWAIS M. LODHI\nStatus: Completed\nDescription: There is no Automated car type classifier available at toll taxes areas. Therefore, we are developing an  efficient application that makes ease by identifying vehicle model, manufacturing year and color. We  have a dataset of approximately one million (936051 images of 55527 vehicles from 400 models)  vehicles to help machines learn the model, manufacturing year and color of each vehicle. Furthermore,  the dataset currently does not have the color information for the vehicles. By using this dataset and  other AI techniques, we will help the machines to learn the make model, manufacturing year and color  of each vehicle. By using the vehicle color classification technique for classifying vehicles into seven  categories under different lighting conditions via colour correction. One major problem in vehicle  colour classification is that for any given colour, there may exist many shade colors: For example,  shades of white (Pearl, Alabaster, Snow, Ivory, etc) and shades of black (Charcoal, Midnight, Ebony,  Onyx, etc). Traditional methods cannot classify vehicles with shade colors because a wrong classifier  is designed by putting vehicles with the same label together even though their chromatic attributes are  different. The separation can significantly improve the accuracy of vehicle color classification even if  vehicles are with various shade colors and captured under different lighting conditions.",
