      "Project: CLASSIFICATION OF CYTOKINE USING MACHINE LEARNING\nAdvisor: MR. DANIYAL AHMED\nStatus: Completed\nDescription: Input: We would give protein sequence (Chemical formula) through amino acids in the form of string.  Output: We make a web portal to display result  Summary: Suppose we have protein sequence of 400 length. Then we convert it into 41 length, 20  length before modified residue and 20 after modified residue. Then we apply kahn\u2019s moment, identity  matrix and other statistical matrix. Then we get the feature vector in which there will be positive and  negative data. Then we add a column in a table on excel sheet for labelling the data, if another protein  has the same modified residue but if it is not a cytokine it will be added to the negative data and vice  versa.  Then we apply models k-mean, k-fold validation and etc. Then we test to calculate accuracy,  sensitivity, f1 scope and if the result is satisfactory then it will be displayed on the web portal  otherwise, we will fine tune the model.",
