      "Project: OLD AGE HOME PLATFORM\nAdvisor: MR. ENGR. SAJID SALEEM\nStatus: Completed\nDescription: <S25BS005>  SDP Phase I (RS)  Page 320  The last century has witnessed a rapid increase in the population of the elderly people in the developed  and industrialized countries. This phenomenon is not restricted to the western world only, but many  countries such as ours are now feeling the impact of this transaction. This situation could be attributed  to a combination of factors such as increase in age, longevity and decreased death rates due to  advancement in the field of medicine, improvement of life expectancy at birth, and enhancement in the  average span of lift. Pakistan ranks 12th in terms of absolute size of elderly population .The country is  not adequately equipped to look after their special health needs and the changing traditional value  system. A feeling is now growing among the aged persons that the attitude of the younger generation  towards them is not as desired.  The data was collected using a specially designed Interview schedule and observation technique  through a house- to-house survey for those residing in the families. Non-working status of these  women and above 60 years of age was criteria for sample selection. Results of the study revealed that  most of the elderly felt the attitude of the younger generation is unsatisfactory towards them especially  those who were in old age homes in terms of getting respect, love and affection from the family  members instead they were considered as burden for others. Women living in the families had a  positive attitude towards old age. The social relationship of the elderly women living in families and  those living in old age home also differed.  Old Age Home Platform is a web application that provides an end-to-end smart web application for old  age people and old age homes. In this platform firstly, we will create a Chabot which will answer the  users some of their FAQs. This platform will provide the login credentials to all the siblings/ child of  the old age home users so they can check their health and food diet on daily basis. With this platform  they can also check whether their forefather/ guardian is critically ill or needs visit. In this platform we  will add e-commerce functionality so if anyone want to donate, they can donate as well. As this is not  for single old age home so in this project, we will target all the old age home of Lahore.",
