      "Project: HSM-E-SPORTS TOURNAMENT ORGANIZER\nAdvisor: MR. ENGR. SAJID SALEEM\nStatus: Completed\nDescription: E-Sports is a form of competition using video games. People play video games to compete against  other players around the world. The most common way to accomplish this is over the internet. E-sports  is a billion dollar industry.  The experience is similar to watching a professional sporting event except  that instead of watching a physical event, spectators watch video gamers compete against each other in  a virtual environment. E -Sports describes the world of competitive and organized video gaming.  Competitors from different leagues or teams face off against each other. Fortnite, PUBG, Apex  Legends League of Legends, Counter-Strike, and Call of Duty to name a few. These gamers are  watched and followed by millions of fans all over the world who attend live events or tune in on TV or  online.    Whenever online gaming tournaments are held, they are held manually. By that what we mean is  normally there aren\u2019t many platforms where teams can register themselves and have a record of their  payments of fee. This creates security and integrity issues. Manual communication is not solid or  consistent. Miscommunication can cause the respective teams problems such as there could be  misinterpretation of the timing schedules or issues regarding the opponent teams.   Our proposed platform would be helpful for players to play online tournaments or matches easily  without any issues. Players will easily register themselves for the matches or tournaments after  submitting the registration fee. Registration fee will be paid through payment gateways. After  complete registration, players will be given a dashboard, from that dashboard players or teams will be  able to see the schedules of their upcoming matches, points table, winning cash amount, profiles of    <S25BS005>  SDP Phase I (RS)  Page 321  opponent team members etc. While playing the tournaments, teams will be able to share the live stream  of their matches using our platform. Teams can win the matches as well as win the extra cash and will  be able to withdraw that cash from their accounts, and they\u2019ll also have the luxury of buying something  from our store using that winning prize.",
