      "Project: MURA  CLASSIFICATION,  ABNORMALITY  DETECTION  IN  MUSCULOSKELETAL RADIOGRAPHS\nAdvisor: MR. MUHAMMAD BILAL KHAN\nStatus: Completed\nDescription: Musculoskeletal conditions will increase as the population of the world ages [1]. For radiologists to  obtain second opinions and to facilitate cases where radiologists are not available, an automated  system capable of analyzing x-ray images is necessary. By using deep learning techniques and the  MURA dataset, this project intends to serve this need by binary classifying X-ray images as normal or  abnormal. The MURA (Musculoskeletal Radiographs) dataset classification is a project undertaken by  researchers to develop algorithms for the automated classification of musculoskeletal radiographs. The  images are organized into seven body parts (shoulder, elbow, wrist, hand, finger, ankle, and foot). The  goal of the project is to develop algorithms that can accurately classify specific body parts as normal or  abnormal. To achieve this, the researchers are using a deep learning model based on convolutional  neural networks (CNNs). The CNNs are trained on a number of different images in order to learn the    <S25BS005>  SDP Phase I (RS)  Page 332  features of each body part, and the model is then tested on the MURA dataset. Results show that the  model is able to accurately predict the normal or abnormal classification of radiographs with an  accuracy of over 80%. This project is an important step forward in the development of automated  medical diagnostics, and could potentially reduce the need for manual interpretation of medical  images.",
