      "Project: ANCIENT CHRONICLES: OPEN-WORLD MMO\nAdvisor: MR. MUSTAFA HASSAN\nStatus: Completed\nDescription: Ancient Chronicles is an open world Massively Multiplayer Online (MMO) game that will support  cross play between computer and console players. The game will support both first person and third  person perspectives for the player to switch between at their convenience.   The game world will consist of multiple levels stacked upon each other like floors and each level will  be a small world with its own theme. Each level will contain 2-3 towns. In these towns, there will be  plains, jungles, deserts and other such environments that the player will have to go through in order to  travel from one town to another. The areas between these towns will be challenging areas that will  contain hostile monsters which will attack players as soon as they are noticed (by being seen or heard).  Besides these monsters, players may encounter other players as well and they may fight each other  without any restrictions. However, the towns will be safe heavens where no combatant will be  permitted. Besides this, there will be a dungeon (a tower like structure) as well. This dungeon will be  the pathway towards the next level and the players will have to clear the dungeon containing monsters.  At the end of the dungeon will be a staircase guarded by a powerful boss like monster and the players  will have to defeat it in order to climb the stairs to the next level.  A quest (missions) system will be implemented. Players may receive quests from Non-Player  Characters (NPC) which they can complete to gain experience (EXP) points to level up. The tasks of  the quests may be as simple as gathering items or as difficult as killing a certain number of monsters.  Leveling up will increase the player\u2019s health, strength, stamina, speed etc. EXP may also be gained by  killing monsters and completing certain achievements.     <S25BS005>  SDP Phase I (RS)  Page 333  The combat system in this game will be strictly melee. Close quarters weapons like great swords, one- handed swords, hammers, lances, nodachis and katanas etc. will be available and the player may freely  choose their weapon of choice. Unlike other MMOs, there will be no class system in this game.  Instead, there will be a proficiency based system that will give the players the freedom they want  instead of restricting their weapons through certain classes. Unlocking skills for weapons will require  you to reach a certain proficiency with that weapon\u2019s type and higher proficiency will be needed to  wield high tier weapons. Proficiency in weapon types can be gained by using the weapons of that  specific type to kill monsters.  The game will have basic slash attacks which can be chained together in different manners to perform  certain combos. Furthermore, there will be some special attacks that will require timed input with  proper coordination in order to be executed (These will be known as Skill Attacks). These attacks will  replace the traditional method of \u2018One button for a skill\u2019, which is implemented in most MMOs and  they will create a sense of skill in the game. Besides attacking there will be mechanisms to Evade,  Block and Parry. However, there will be some Skill Attacks that may be unlockable or non- interruptible.   There will be a basic level implementation of a marketplace where players may buy and sell weapons,  armor, healing potions, antidotes etc.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
