      "Project: ONLINE WEB PORTAL DEEPFAKE DETECTION USING DEEP LEARNING\nAdvisor: DR. MUZAMMIL HUSSAIN\nStatus: In Process of Completion\nDescription: The proliferation of Artificial Intelligence (AI) has revolutionized technological usage, enabling the  development of applications with minimal power and resource requirements. Among these innovations  is Deepfakes, a technology capable of convincingly altering videos and images, presenting profound  implications for privacy, security, and societal stability. The manipulation of visual content by  Deepfakes poses significant challenges, exacerbated by the complexity of detecting such alterations  due to advanced AI techniques like Generative Adversarial Networks (GANs). Addressing this  challenge, our research introduces a method to identify fake faces within images and videos. Our  approach begins with the identification of faces in visual media, followed by the extraction of intricate  facial features using the sophisticated Deep Learning model, DenseNet-169. Subsequently, these  extracted features are subjected to classification using Support Vector Machine (SVM) algorithms to  discern between genuine and manipulated content. Through comprehensive comparative analyses, we  have determined that the combination of DenseNet-169 and SVM offers the most effective solution for  detecting fake faces. In pursuit of broader accessibility and usability, we intend to develop a user- friendly web application utilizing Django, offering an intuitive interface to empower individuals in  verifying the authenticity of visual content. By bridging the gap between cutting-edge research and  practical implementation, our Endeavor aims to mitigate the risks associated with Deepfake technology  and foster informed engagement with digital media.    <S25BS005>  SDP Phase I (RS)  Page 455",
