      "Project: INTESTISCAN: GASTROINTESTINAL DISEASE CLASSIFICATION\nAdvisor: MR. MUHAMMAD BILAL KHAN\nStatus: In Process of Completion\nDescription: Currently, nearly two million patients die of gastrointestinal diseases worldwide. Video endoscopy is  one of the latest technologies in the medical imaging field for the diagnosis of gastrointestinal diseases,  such as stomach ulcers, bleeding, and polyps. Medical video endoscopy generates many images, so  doctors need considerable time to follow up all the images. This creates a challenge for manual  diagnosis and has encouraged investigations into computer-aided techniques to diagnose all the  generated images in a short period and with high accuracy. This project represents a notable  advancement by undertaking the creation of an AI assistant tailored explicitly for the biomedical  industry, with a central focus on precise image analysis of gastrointestinal diseases, utilizing the  extensive Kavsir dataset. The primary objective is to aid patients and healthcare professionals in  comprehending and interpreting gastrointestinal images effectively. IntestiScan incorporates advanced  techniques leveraging the comprehensive Kavsir dataset, rich with labelled gastrointestinal images.  The goal is to offer users a dependable and educational platform for gaining insightful knowledge from  gastrointestinal data, thereby augmenting their understanding. This initiative facilitates swift and  accurate diagnoses of gastrointestinal diseases using the Kavsir dataset, providing a trustworthy  resource for healthcare professionals and the public.",
