      "Project: COUNTERFEIT MONEY DETECTOR\nAdvisor: MR. SYED M. MUJTABA HASSAN\nStatus: In Process of Completion\nDescription: The purpose of this app is to develop a mobile application for the detection of counterfeit money.  Currently, there is an app that only provides information about the banknotes but does not detect fake  money. Nowadays, Counterfeit currency is a burning question throughout the world. The counterfeiters  are becoming harder to track down because of their rapid adaptation with highly advanced technology.  One of the most effective methods to stop counterfeiting can be the outspread use of counterfeit  detection tools/software that are easily available and are efficient in terms of cost, reliability, and  accuracy we face a lot of economic crisis with the counterfeiting of money. By reducing or eliminating  the chances of money counterfeiting we can improve the economy and save people from financial loss.  For this purpose, we are proposing a Counterfeit Money Detector application that will detect the note  by the method of deep learning techniques. After analyzing the image of the note it will generate a  report that will tell if the note is fake or not. If the note is fake then it will provide us the reason behind  that why the currency is counterfeit. By using our application we can easily reduce the chances of  money counterfeiting.    <S25BS005>  SDP Phase I (RS)  Page 474",
