      "Project: IOT ENABLED DATA SCIENCE-DRIVEN CROP HEALTH MANAGEMENT  FOR PAKISTANI FARMERS\nAdvisor: MR. M. REHAN SALEEM\nStatus: In Process of Completion\nDescription: Agriculture is the backbone of Pakistan's economy,  yet it faces numerous challenges such as declining  productivity,  inefficient  resource  utilization,  and  the  adverse  effects  of  climate  change.   Traditional farming  methods  often  rely  on  intuition  rather  than  data,  leading  to  suboptimal   decision-making  and resource  wastage.  This  project  aims  to  revolutionize  farming  practices  by   developing  a  Smart Agricultural Advisory System that integrates IoT and data analytics to provide  real-time  Alerts for farmers.  The system integrates multiple sensors, including Soil Moisture,  Temperature and Humidity, Light Intensity, pH, Carbon Dioxide, and Air Quality sensors, to collect  critical environmental and soil data. Additionally, it utilizes a weather API to gather localized weather  information, enhancing the system\u2019s ability  to  predict  and  mitigate  risks.  The  data  is  processed   and  visualized  on  an  online  dashboard, accessible through smart devices, enabling farmers to  monitor conditions in real time.  A  key  feature of  the  system  is  its  ability  to  generate  alerts   based  on  predefined  thresholds  for  sensor readings  and  weather  conditions.  These  alerts  help   farmers  take  timely  actions,  such  as  adjusting irrigation schedules during extreme weather events  or addressing soil nutrient deficiencies.  The project draws upon knowledge areas such as IoT device  communication, API integration, data preprocessing, cloud analytics, and user-centric dashboard  design. By combining sensor data with weather  insights, the system delivers recommendations that  support sustainable resource  management and improve crop productivity.  The  expected  outcomes   include  a  fully  functional  prototype  capable  of  monitoring  environmental conditions,  providing   real-time  recommendations,  and  issuing  alerts.  This  system  aims  to  empower farmers  with  data- driven  tools  to  enhance  decision-making,  reduce  resource  wastage,  and  increase agricultural     <S25BS005>  SDP Phase I (RS)  Page 594  resilience  against  climate  variability.  Ultimately,  it  represents  a  step  towards  precision  agriculture and sustainable farming practices in Pakistan.",
