      "Project: STROKEGUARD\nAdvisor: DR. RABIA TEHSEEN\nStatus: In Process of Completion\nDescription: Brain stroke is one of the leading causes of death and long-term disability globally, with  millions of people effected annually. A major contributor to stroke-related complications  is the lack of real-time monitoring and early warning systems, which delays medical  intervention.   The proposed project introduces a web application integrated with a wearable device that  utilizes AI and machine learning algorithms to provide real-time stroke risk assessments  and personalized health guidance. The platform includes an AI-powered chatbot where  users can manually input their symptoms. The chatbot first determines whether the  entered symptoms are stroke-related or not. If they are, it then engages the user with  follow-up questions for a more detailed assessment. Based on the responses and the  monitored vital data, the system calculates and displays a numeric probability score  indicating the likelihood of a stroke occurring in the near future, along with preventive  advice and recommendations for medical consultation.   The system has an automated monitoring system that continuously collects vital signs  such as blood pressure, heart rate and other vitals by a connected wearable device and  analyzes user reported symptoms to evaluate the risk of a stroke. This system is designed  for both high-risk individuals and stroke survivors. A key feature of the system is its  emergency alert, which instantly warns users when any vital sign exceeds a predefined  safety threshold, enabling timely lifesaving action. It sends an emergency alert to user  mobile as well as user care giver that tell them to take immediate action and also tell them  about nearest available doctor. By automating the detection and response process, this  intelligent system fills a critical gap in non-clinical healthcare monitoring, aiming to  reduce stroke-related mortality and disability through early intervention, continuous  awareness, and proactive health management.",
