      "Project: DEEPFAKE IMAGE CLASSIFICATION USING  TRANSFER LEARNING\nAdvisor: DR. SAIRA ANDLEEB GILLANI\nStatus: In Process of Completion\nDescription: The increasing sophistication of deepfake technologies has made image-based  misinformation a critical threat to digital authenticity and trust. This project proposes a  deepfake image classification system that combines the power of transfer learning with  the efficiency of lightweight deployment. By utilizing pre-trained convolutional neural  networks (CNNs) \u2014 Xception and MobileNet \u2014 the system performs binary  classification of facial images (real vs. fake) while significantly reducing training time        Page 601  and computational load. These models are fine-tuned using high-quality public datasets  such as FaceForensics++ and Celeb-DF, which offer diverse and challenging manipulated  images to ensure the model\u2019s robustness and generalization across real-world scenarios.  Image preprocessing steps include resizing, normalization, and augmentation techniques  to enhance training diversity and prevent overfitting. The model evaluation will  incorporate key performance metrics such as accuracy, precision, recall, F1-score,  confusion matrix, and ROC-AUC to provide a detailed assessment of classification  performance. To maximize accessibility, the trained model is integrated into a responsive  web interface using Streamlit, allowing end users to upload and analyze images in real  time. The system also supports batch image processing, enabling efficient large-scale  detection.  Technically, the project encompasses core areas such as deep learning with TensorFlow  and Keras, image processing with OpenCV, data handling with NumPy and Pandas, and  interactive web application development. The final deliverable is a functional, scalable,  and user-friendly software tool that can serve practical needs in digital media forensics,  journalism, cybersecurity, and legal investigations, offering an end-to-end solution for  real-time deepfake detection.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
