      "Project: THE FORSAKEN FORT (A HORROR GAME)\nAdvisor: DR. SAIRA ANDLEEB GILLANI\nStatus: In Process of Completion\nDescription: The Forsaken Fort aims to address a significant gap in the horror game genre. This project  combines cultural storytelling, advanced gameplay mechanics, and immersive design to  create a unique horror experience based on Pakistani folklore.  \uf0b7  Problem Description:  o Modern horror games often follow predictable patterns and neglect  culturally rich narratives.  o Lack of innovative gameplay that uses sound, environment, and player  behavior dynamically.  \uf0b7  Significance of the Problem:  o Many games in the genre fail to offer a unique or meaningful experience  beyond jump scares or gore.  o There is a significant underrepresentation of regional folklore and cultural  narratives in the horror game industry.  o Existing games do not integrate real-world interactions (like sound) into  the core gameplay mechanics.  \uf0b7  Objective:  o Create a horror game deeply rooted in Pakistani folklore, offering a fresh  narrative and gameplay experience.  o Implement AI-driven sound detection that reacts to real-world noise levels,  creating a dynamic and immersive atmosphere.  o Develop multiplayer and single-player modes where players uncover the  village\u2019s dark history while surviving against supernatural threats.  \uf0b7  Gameplay Features:  o Setting: A haunted village and a cursed fort, steeped in supernatural  entities drawn from Pakistani folklore.  o Core Gameplay:  \uf0a7  Exploration, puzzle-solving, and survival.  \uf0a7  Avoidance of AI-controlled entities that react to sound (e.g., player  noise detected via microphone).        Page 602  \uf0a7  A multiplayer mode for up to four players offering cooperative  survival mechanics.  o Sound Detection Mechanic:  \uf0a7  Real-time microphone integration that makes in-game entities react  to the player\u2019s real-world noise (e.g., speaking, moving).  \uf0a7  The AI entities are drawn to or repelled by noise, adding a strategic  layer to gameplay.  \uf0b7  Knowledge Areas to be Utilized:  o Game Development: Unity (C#), asset integration, and scene design.  o Artificial Intelligence: Dynamic behavior of in-game entities based on  sound detection and player actions.  o Networking: Real-time multiplayer features, synchronization, and  cooperative gameplay.  o Audio Processing: Real-world sound integration and the impact of noise  on gameplay mechanics.  o Cultural Storytelling: Incorporating regional folklore and supernatural  creatures from Pakistani myths.  \uf0b7  Expected Results:  o Playable Prototype: Demonstration of the core gameplay mechanics,  including sound-driven AI behavior and multiplayer capabilities.  Documentation: A comprehensive technical report detailing design decisions,  implementation of sound detection, and AI-driven mechanics.",
