      "Project: FINTREND\nAdvisor: MR. USMAN AAMER\nStatus: In Process of Completion\nDescription: In  the  ever-evolving  world  of  finance,  investors  demand  more  than  just  numerical   data  to  make decisions\u2014they need insights derived from real-time sentiment and news.  FinTrend is a web-based AI platform that integrates Natural Language Processing (NLP)  and time-series deep learning to predict short-term stock market trends. By combining  structured data (historical stock prices) with unstructured data  (financial  news   sentiment),  FinTrend  provides  a  more  holistic  and  timely  forecast  to  empower  investors.  Unlike  traditional  prediction  systems  that  ignore  immediate  market   influencers  like  news events, FinTrend leverages cutting-edge models like FinBERT for  sentiment analysis and LSTM/GRU for  trend  prediction.  The  platform  is  tailored  to   help  both  individual  investors  and  financial  analysts make data-backed investment  decisions.        Page 634",
