      "Project: MELANOMA DETECTION ALLY\nAdvisor: MR. USMAN AAMER\nStatus: In Process of Completion\nDescription: Skin cancer, particularly melanoma, is one of the most dangerous forms of cancer due to  its potential to spread rapidly if not detected early. Traditional diagnosis methods require  clinical visits, expert evaluation, and expensive procedures, which can be inaccessible or  time-consuming for many individuals. This project presents Melanoma Detection Ally, a  cross-platform mobile application designed to detect melanoma using deep learning  techniques. The application allows users to upload images of their skin lesions, which are  analyzed using custom built deep learning models. These models-based on CNN, VGG,  AlexNet, and ResNet variants will be trained from scratch using a comprehensive dataset  compiled from the ISIC Archive, including HAM10000 and ISIC 2010\u20132024. The  system will generate a diagnostic classification along with a confidence score, providing  users with insight into the AI\u2019s prediction. This project integrates knowledge from  computer vision, medical image processing, neural networks, and mobile development.  By combining robust model training with user-friendly mobile application deployment,  the solution aims to support early-stage melanoma detection and raise awareness of skin  health through accessible technology.",
