      "Project: VIGILANTEYE\nAdvisor: MR. USMAN AAMER\nStatus: In Process of Completion\nDescription: Stegomalware\u2014malicious code concealed within seemingly harmless images like  animated GIFs\u2014represents an evolving threat that often slips past conventional  signaturebased scanners. VigilantEye addresses this gap by systematically evaluating  three stateoftheart deep learning paradigms\u2014Convolutional Neural Networks (CNNs),  Transformer models, and Generative Adversarial Networks (GANs)\u2014for their ability to  detect hidden payloads. We assemble a curated dataset of both clean and stegoinfected  GIFs, apply preprocessing steps to extract entropy, metadata, and pixellevel features, and  train each architecture under consistent settings.  To demonstrate practicality, we build a lightweight prototype interface (web or mobile)  that allows controlled image uploads and delivers realtime inference with clear  confidence scores. Our work yields a concise benchmark of detection accuracy,  falsepositive rates, and computational requirements, offering actionable insights for future  research and the development of robust defenses against multimediabased malware.",
