      "Project: ANOMALYCRYPT:  CHOAS-DRIVEN  FRAMWORK FOR SECURE IMAGE ENCRYPTION  AND ABERRATION DETECTION\nAdvisor: MR. ANNAS WASEEM MALIK\nStatus: In Process of Completion\nDescription: This project proposes AnomalyCrypt, a unified security framework specifically designed  for resource-constrained IoT devices that combines selective chaos-based grayscale  image encryption with machine learning- based anomaly detection. Unlike existing  approaches that require full decryption for tamper verification, our system uses Region of  Interest (ROI)- based selective encryption to preserve structural information necessary for  direct anomaly detection on encrypted images. The framework implements a novel  chaotic map for secure ROI encryption while maintaining computational efficiency  suitable for IoT sensors, drones, and embedded systems. The machine learning module  performs pixel-level anomaly detection without requiring full decryption, generating  heatmap visualizations for tampered regions. The system includes secure communication  protocols between Raspberry Pi nodes to demonstrate real- world IoT deployment  scenarios. A Flutter-based interface provides monitoring and visualization capabilities.  The research contribution includes comparative analysis against existing frameworks,  evaluation on resource- constrained hardware, and validation of the security-efficiency  trade-off in selective encryption approaches.        Page 671",
