      "Project: THE OBSIDIAN ETERNITY: GATHER THE  RELICS, AWAKEN THE  PORTAL,  SAVE THE  WORLD\nAdvisor: MR. M. UMAR HAMEED\nStatus: In Process of Completion\nDescription: Background & Motivation. Action\u2013stealth games blend path planning, perception, and  environment interaction. Our FYP uses this genre to show applied AI (patrols, awareness,  search states), systems programming (input, physics, UI), and production workflow  (assets, audio, cutscenes). The narrative gives clear purpose to collecting the five relics:  assembling a device that purifies pathogens and prevents global catastrophe. Core  Concept. Five escalating missions each spotlight a key mechanic: 1.  Warehouse  Raid \u2013 stealth tutorial (crates, shadows, simple patrols). 2. City Van Intercept \u2013 chase &  quick-time interception among traffic. 3.  Police  Evidence  Heist  \u2013  disguises,  keypad/lock hacking, CCTV cones. 4.  Jungle Border Escape \u2013 platforming, trap  timing, multi-patrol routes. 5. Mountain Fortress \u2013 layered infiltration, boss-style  encounter, multipath solutions. Game Systems. \u2022  AI Guards: Finite State Machine  (Idle \u2192 Patrol \u2192 Suspicious \u2192 Chase \u2192 Search \u2192 Return) with line-of-sight + hearing  thresholds; optional Behavior Tree decorators for context (cover seeking, flanking, calling  backup). \u2022  Perception: Vision cones using frustum checks + raycasts; sound events  with falloff radius; suspicion meter. \u2022 Navigation: Unity NavMesh for patrols, dynamic  obstacles during chases, off-mesh links for climbs/jumps. \u2022 Stealth  Tools:  Disguises  (restricted areas), noise decoys, light/sound awareness, hiding spots. \u2022  Puzzles:  Lockpads (pattern/sequence), terminals (wire-connect minigame), circuit breakers  (camera loops). \u2022  Chase/QTE: Short, cinematic sprints with simple inputs for  vaulting, sliding, intercepting the van. \u2022  Progression: Each relic unlocks a passive  bonus (e.g., longer distraction, faster hack, wider stealth meter). \u2022 Cinematics: Opening        Page 695  hook (virus threat); ending cutscene where the assembled device emits a cleansing energy  wave that disables the syndicate\u2019s payload worldwide. Production Plan (Phases). \u2022 P0  \u2013  Pre-production (2\u20133 weeks): Game Design Document (scope, levels, assets list), blockout  of all 5 levels with gray boxes, AI prototypes in a test arena. \u2022  P1 \u2013 Core Mechanics  (3\u20134 weeks): Player controller (walk/run/crouch/climb), stealth vision/hearing, patrol  paths, suspicion meter, basic UI/HUD. \u2022  P2 \u2013 Level Pass 1 (3\u20134 weeks): Build Levels  1\u20133 to alpha; implement warehouse stealth, van chase, evidence-room heist; placeholder  art and sounds. \u2022  P3 \u2013 Level Pass 2 (3\u20134 weeks): Build Levels 4\u20135; add traps, multi- path fortress, boss logic; first cinematic draft. \u2022  P4 \u2013 Polish & Optimization (2\u20133  weeks): Replace placeholders with Blender/Mixamo assets, lighting, post-FX; bake  navmesh; occlusion culling; bug fixing; playtests; Windows build. \u2022  P5  \u2013  Documentation & Defense (final 1\u20132 weeks): User manual, testing report, performance  metrics, trailer made in DaVinci Resolve. Tools (All Free). Unity, Blender, Mixamo,  GIMP/Krita, Audacity, DaVinci Resolve; free assets (Unity Asset Store/Freesound).  Evaluation & Metrics. \u2022  Playability: Tutorial completion rate \u226590%; mean level  completion time matches design targets. \u2022  AI Behavior: Guards transition correctly  across states; detection/false-positive rate within tuned bounds. \u2022  Performance: \u226560 FPS  on mid-range PC at 1080p; memory stable (no leaks). \u2022  Quality: <20 known non- blocking bugs; consistent UX and readable UI. Ethics & Safety. No real-world hacking,  weapons, or government affiliation. Fictional virus; non-graphic, non-violent  presentation. Risks & Mitigation. Scope creep \u2192 stick to 5 compact levels; complex AI  \u2192 begin with FSM, add BT only if time allows; asset load \u2192 prefer stylized low-poly to  keep performance high. Result. A cohesive, story-driven stealth game demonstrating AI,  systems, design, and polish suitable for FYP defense.",
