      "Project: MINDMAPME:  ADHD-FRIENDLY  PRODUCTIVITY & JOURNALING APP POWERED  BY AI\nAdvisor: MR. QAISER HABIB\nStatus: In Process of Completion\nDescription: Managing daily tasks and maintaining focus are significant challenges for individuals  with Attention Deficit Hyperactivity Disorder (ADHD). Existing productivity and  journaling applications are often too generic, requiring high manual effort and failing to  address ADHD-specific struggles such as unstructured thinking, difficulty in task  initiation, and mood regulation. MindMapMe proposes an AI-powered productivity and  journaling assistant that leverages a fine-tuned Large Language Model (LLM) to directly  address these challenges. Users will record quick voice notes, which will be transcribed  into text using a speech-to-text system. The fine-tuned LLM will then convert these  unstructured notes into structured tasks, journals, and mood insights, trained specifically  on ADHD-related data to ensure relevance and accuracy. To improve time management  and reduce cognitive load, the system will integrate with the Google Calendar API,  automatically aligning extracted tasks with schedules. Additionally, the Weather API will  be used to provide context-aware productivity recommendations, acknowledging that  environmental conditions can influence focus and motivation. The outcomes of this  project will include: 1. A fine-tuned LLM model adapted to ADHD-related journaling  and productivity data. 2. A mobile application with an ADHD-friendly interface that  supports voice journaling, smart scheduling, and contextual insights. 3. A research  contribution that demonstrates how domain-specific fine-tuning of LLMs enhances the  usefulness of AI-powered productivity systems for neurodiverse users. By narrowing its  scope to fine-tuned LLM-based journaling and productivity support, MindMapMe offers  a focused, innovative, and practical solution with both academic and market relevance.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
