      "Project: VEHICLE VITALS\nAdvisor: MS. BEENISH ZAFAR\nStatus: In Process of Completion\nDescription: In Pakistan and many other countries, personal vehicles are essential for daily commuting  and transport. However, most owners do not follow proper maintenance schedules, often  due to forgetfulness or lack of knowledge. Essential tasks such as oil changes, air filter  replacements, tire checks, brake inspections, and tuning are frequently delayed or  skipped, resulting in poor vehicle performance, increased fuel consumption, unexpected  breakdowns, and higher repair costs. Current solutions like notebooks, spreadsheets, or  third-party apps such as Fuelio offer fuel or expense logging but lack intelligence,  reminders, and local relevance. Most are either too complex for everyday users or  targeted at fleets, leaving a clear gap for a simple, localized, and intelligent mobile app  for individual car and bike owners. To address these gaps, Vehicle Vitals will provide  innovative features alongside basic logs and reminders, including Fuel Cost Prediction to  estimate monthly expenses, a Vehicle Health Score for quick condition insights, an  Odometer Scanner(for digital meters) to reduce manual data entry, and an AI-powered  Chatbot Q&A for common maintenance queries. Additionally, anomaly detection and  visual dashboards will support timely decision-making and efficient vehicle care. The  project will leverage mobile application development (Flutter), backend management  (Laravel + MySQL), AI-based anomaly detection, chatbot integration (Dialogflow), and  data visualization(Graphs etc) to implement the system. The expected outcomes include  organized maintenance tracking, improved fuel efficiency, timely service reminders, and  enhanced user convenience, empowering vehicle owners to manage their cars and bikes  effectively without technical expertise.",
