      "Project: SMARTGRADE USING AI\nAdvisor: MS. BEENISH ZAFAR\nStatus: In Process of Completion\nDescription: Page 718  Manual grading is often slow, inconsistent, and affected by human bias and human errors,  especially for descriptive answers and large-scale assessments. To solve this, we propose  SmartGrade, an automated system that evaluates multiple question types including  descriptive, objective, and numerical problems. The system works with relevant reference  data provided by educators such as model answers, answer keys, and solution steps,  which serve as the benchmark for grading. Using NLP models (BERT), SmartGrade  measures not only the correctness but also the relevance of student responses to the given  question and reference answer. OCR technology further enables the evaluation of  handwritten as well as digital answer sheets. Objective questions are matched against  predefined correct options, while numerical problems are validated against final solutions  with optional stepwise checking. By combining semantic similarity, OCR, and rule-based  evaluation, SmartGrade ensures faster, fairer, and more reliable grading, while still  allowing teacher review where needed. Expected outcomes include reduced workload for  educators, consistent scoring, and timely, transparent feedback for students.",
