    responseText:
      'Project: SAFEHER  AI:  PROACTIVE  SAFETY  ECOSYSTEM FOR WOMEN\nAdvisor: MS. MAHRUKH BATOOL\nStatus: In Process of Completion\nDescription: Women\u2019s safety has become one of the most critical issues in today\u2019s society,  especially  in Pakistan, where many students and working women face  harassment and unsafe travel  situations on a daily basis. Most existing safety  apps only respond after an incident has  already occurred which means they are  reactive rather than preventive.  Our project,  SafeHer AI, aims to change that. It is a proactive and intelligent  safety application that  uses Artificial Intelligence (AI) to predict unsafe routes  and prevent possible threats  before they happen. The system analyzes multiple  factors such as crime reports, time of  day, location data, and community  feedback to calculate a Route Safety Score, helping  users make safer travel  decisions.  In an emergency, the app allows users to activate an  SOS alert through voice  command (for example, saying \u201cHelp Me!\u201d). The alert instantly  shares the  user\u2019s live location and audio evidence with her guardians and the nearest   police control room. This direct connection with the police department  ensures  immediate action and quick response.  SafeHer AI also introduces a Campus Safety Mode  for universities, where  students can report incidents, receive real-time alerts from campus  security, and  access verified transport and nearby police contact information. This feature   will help educational institutions improve their internal safety systems and  ensure a safer  environment for female students.  Other features include a Fake Call and Siren option, a  Guardian Circle for  trusted contacts, Community-Based Danger Heatmaps, Anomaly  Detection  for unusual travel behavior, and Discreet Audio/Video Recording for evidence   collection.  With SafeHer AI, we aim to build more than just a mobile app our goal is to   create a reliable and intelligent safety ecosystem that empowers women to  travel freely  and confidently.  "SafeHer AI represents our commitment to use technology for real  social impact  creating a safer, smarter, and stronger community for women everywhere.\u201d',
