      "Project: ZENNO: AI COMPANION FOR DEVELOPER  CONTEXT AWARENESS, REAL-TIME PROFILING  AND SMART COLLABORATION\nAdvisor: MS. MAHWISH SHAHID \n \n \n \nPage 721\nStatus: In Process of Completion\nDescription: Zenno is an intelligent AI-augmented companion for developers, designed to build a  contextual relationship between users and their devices while enabling live skill-based  connections and smart hiring. The system passively collects local behavioural data (editor  activity, typing bursts, coding environments) through a lightweight agent, and applies  local ML processing using clustering  and classification to infer real-time states (focused,  distracted, idle). These insights are shared with a fine-tuned NLP model to deliver  personalized nudges (motivational, coaching, peer support). Zenno further constructs  dynamic, live skill profiles reflecting real tools and frameworks in use, enabling  developers to connect with peers and allowing recruiters to search talent based on real- world capabilities rather than static resumes. The project aims to improve focus, foster  developer communities, ensure transparent skill visibility, and redefine hiring with  privacy-respecting, behaviour-backed analytics.",
