      "Project: HELPING HAND\nAdvisor: MR. MOHSIN SAMI\nStatus: In Process of Completion\nDescription: Food, clothing, and blood aren't luxuries; they are the foundation of a safe, healthy, and  dignified life. There are so many white-collar individuals who are needy but can\u2019t ask for        Page 745  help and are too shy to come up to the front. These are people who may appear financially  stable, they might be educated, working low income jobs, or from formerly better off  families, but silently struggle to afford food, clothing, and basic necessities. They have no  one to support them, and because of societal pressure and fear of judgment, they avoid  seeking help to protect their dignity. Helping Hand aims to bridge the gap between  surplus resources and communities in need by leveraging technology for efficient,  respectful, and transparent redistribution. In Pakistan, approximately 40% of food is  wasted annually while 37% of the population faces food insecurity. Alongside, thousands  of tons of wearable clothing are discarded, hospitals struggle with urgent blood shortages,  and many low income individuals or students silently face financial hardships. Current  donation systems are fragmented, manual, or lack real time coordination, leaving  significant gaps in accessibility and dignity for recipients. Helping Hand addresses this by  providing a unified mobile application that integrates food redistribution, clothing  donations, blood donation coordination, and confidential community help requests. Using  geolocation, instant notifications, and smart matching, the system ensures that surplus  resources are directed to verified recipients based on urgency and location. Donors and  organizations are further supported with features such as real time feedback, trust scoring,  flexible donation modes, and event/campaign management for large scale drives. This  project combines concepts from software engineering, mobile app development,  databases, and algorithm design to create a scalable, user-friendly solution. The expected  outcome is a transparent and reliable platform that fosters a circular economy where  surplus resources are effectively utilized, ensuring that every meal, piece of clothing,  blood donation, or financial contribution directly improves lives while maintaining the  dignity of those receiving help.",
    pdfUrl: "/Ongoing and Completed Projects-13-11-2025.pdf",
