      "Project: PENNYWISE:  INTELLIGENT  SHOPPING  &  BUDGETING PLATFORM\nAdvisor: MR. MOHSIN SAMI\nStatus: In Process of Completion\nDescription: Online shopping in Pakistan is expanding rapidly, offering access to a wide range of  products across platforms such as Daraz, PriceOye, Naheed, and Al-Fatah. However, the  experience remains scattered and inefficient. Buyers must manually compare prices,  while small sellers struggle with fair pricing and visibility. PennyWise: Intelligent  Shopping & Budgeting Platform is developed as a mobile application to address this gap.  It unifies product listings from multiple online stores, compares prices automatically, and  provides budget-aware recommendations through an interactive chatbot assistant. The  system focuses on key shopping categories including electronics (mobile phones, laptops,  tablets, earphones), fashion (clothing, shoes, jewelry, bags), and home & kitchen (small  appliances, cookware). It includes features such as a chatbot shopping assistant, multi- store aggregation, price drop alerts, and a seller dashboard offering detailed pricing  insights.  Buyers save time and find the best deals, while sellers gain tools to stay  competitive. This project applies data processing, web scraping, information retrieval, and  data analysis techniques to create a localized, intelligent, and user-friendly e-commerce  ecosystem for Pakistan.",
